import { createBrowserRouter } from "react-router-dom";

import App from "../App";
import Dashboard from "../pages/Dashboard";

import Login from "../Component/Login";
import AddCategory from "../pages/category/addCategory";

const router = createBrowserRouter([
  {
    path: "/",
    element: <Login />, // App is the parent layout
  },
  {
    path: "/",
    element: <App />, // App is the parent layout
    children: [
      {
        path: "/dashboard",
        element: <Dashboard />, // Standalone Login route
      },
      {
        path: "/dashboard",
        element: <App />, // Standalone Login route
      },
      {
        path: "/add/category",
        element: <AddCategory />,
      },
      // {
      //   path: "/add/category",
      //   element: <AddCategorY />,
      //   // Standalone Registration route
      // },
      // {
      //   path: "/all/category",
      //   element: <allCategory />, // Standalone Registration route
      // },
    ],
  },
]);

export default router;
